const Chart = () => {

    return (
        <div style={{ marginBlock: '40px' }}>
            <iframe id="dextools-widget"
                title="DEXTools Trading Chart"
                width="500"
                height="400" src="https://www.dextools.io/widgets/en/bnb/pe-light/0xa8beebeef1be5265d7efa64857f1c5c59f53dc98?theme=light&chartType=2&chartResolution=30&drawingToolbars=false"></iframe>
        </div>
    );
};

export default Chart;
